TfLiteRegistration* Register_rmezmo_REF() {
  static TfLiteRegistration r = {rmezmo::Init, rmezmo::Free,
                                 rmezmo::Prepare<rmezmo::kReference>,
                                 rmezmo::Eval<rmezmo::kReference>};
  return &r;
}

TfLiteRegistration* Register_rmezmo_GENERIC_OPT() {
  static TfLiteRegistration r = {rmezmo::Init, rmezmo::Free,
                                 rmezmo::Prepare<rmezmo::kGenericOptimized>,
                                 rmezmo::Eval<rmezmo::kGenericOptimized>};
  return &r;
}

